svg.script:

var currency = document.getElementById('currency');
var layers = Array.from(currency.children);
var currentLayerIndex = 0;

function hideLayer(layer) {
    var path = layer.querySelector('path');
    path.style.fillOpacity = 0;
    path.style.fillRule = 'nonzero';
}

function showLayer(layer) {
    var path = layer.querySelector('path');
    path.style.fill = 'rgb(2,2,2)';
    path.style.fillOpacity = 1;
    path.style.fillRule = 'nonzero';
}

// Initially hide all layers except the first one
layers.forEach((layer, index) => {
    if (index !== currentLayerIndex) {
        hideLayer(layer);
    } else {
        showLayer(layer);
    }
});

// Select all elements with the class "bills"
var clickableAreas = document.querySelectorAll('.bills');

// Add click event listener to each clickable area
clickableAreas.forEach(function(area) {
    area.addEventListener('click', function() {
        // Hide current layer
        hideLayer(layers[currentLayerIndex]);

        // Move to next layer
        currentLayerIndex = (currentLayerIndex + 1) % layers.length;

        // Show next layer
        showLayer(layers[currentLayerIndex]);
    });
});

document.addEventListener('dblclick', function() {
    var flames = document.getElementById('flames-');
    var flame1 = document.getElementById('flame-1');
    var flame2 = document.getElementById('flame-2');
    var flame3 = document.getElementById('flame-3');
    var flame4 = document.getElementById('flame-4');

    if (flame1.classList.contains('animateFlames')) {
        flame1.classList.remove('animateFlames');
        flame2.classList.remove('animateFlames');
        flame3.classList.remove('animateFlames');
        flame4.classList.remove('animateFlames');
        flames.style.opacity = '0';
    } else {
        flame1.classList.add('animateFlames');
        flame2.classList.add('animateFlames');
        flame3.classList.add('animateFlames');
        flame4.classList.add('animateFlames');
        flames.style.opacity = '1';
    }
});
